/****** SYSTEM REQUIREMENTS *****/
/****** SYSTEM REQUIREMENT 1 *****/
	/* The servo motor installed in the door will lock or */
	/* unlock based on the correct PIN code received by */
	/* the button. If the door is unlocked and the PIN is */
	/* correct, it will lock. If the door is locked and */
	/* the PIN is correct, it will unlock. */
/****** SYSTEM REQUIREMENT 2 *****/
	/* The webserver provides a web page about lock or */
	/* unlock state of the door. */
/****** END SYSTEM REQUIREMENTS *****/

/* START CODE */

/****** DEFINITION OF LIBRARIES *****/
#include <EasyButton.h>	//https://github.com/evert-arias/EasyButton
#include <Deneyap_Servo.h>	//https://github.com/deneyapkart/deneyap-servo-arduino-library

/****** FUNCTION PROTOTYPES *****/
void setup(void);
void loop(void);
void updateOutputs();
void handleButtonPress();
void startWebServer();
void handleClient();

/***** DEFINITION OF DIGITAL INPUT PINS *****/
const uint8_t codeButton_PushButton_PIN_D9		= 9;

/***** DEFINITION OF PWM OUTPUT PINS *****/
const uint8_t servo_Servomotor_PWMSignal_PIN_D2		= 2;

/***** DEFINITION OF OUTPUT RAW VARIABLES *****/
uint8_t	servo_Servomotor_PWMSignal_PIN_D2_rawData		= 0;

/***** DEFINITION OF OUTPUT PHYSICAL VARIABLES *****/
float	servo_Servomotor_PWMSignal_PIN_D2_phyData		= 0.0;

/***** PIN CODE VARIABLES *****/
const String correctPIN = "1234"; // Set your correct PIN code here
String enteredPIN = ""; // Variable to store the entered PIN
bool doorLocked = true; // Initial state of the door (locked)

/****** DEFINITION OF LIBRARIES CLASS INSTANCES*****/
EasyButton codeButton(codeButton_PushButton_PIN_D9);
Servo myServo;

/****** SETUP FUNCTION *****/
void setup(void)
{
	// Initialize serial communication
	Serial.begin(115200);

	// Initialize button
	codeButton.begin();
	codeButton.onPressed(handleButtonPress);

	// Initialize servo
	myServo.attach(servo_Servomotor_PWMSignal_PIN_D2);

	// Start web server
	startWebServer();
}

/****** LOOP FUNCTION *****/
void loop(void)
{
	// Update button state
	codeButton.read();

	// Handle web client
	handleClient();

	// Refresh output data
	updateOutputs();
}

/****** BUTTON PRESS HANDLER FUNCTION *****/
void handleButtonPress()
{
	// Simulate entering a PIN code (for demonstration purposes)
	// In a real application, you would read the PIN from a keypad or similar
	enteredPIN = correctPIN; // Simulating correct PIN entry

	if (enteredPIN == correctPIN)
	{
		// Toggle door lock state
		doorLocked = !doorLocked;

		// Update servo position based on door state
		if (doorLocked)
		{
			servo_Servomotor_PWMSignal_PIN_D2_rawData = 0; // Lock the door
		}
		else
		{
			servo_Servomotor_PWMSignal_PIN_D2_rawData = 180; // Unlock the door
		}
		Serial.println(doorLocked ? "Door Locked" : "Door Unlocked");
	}
}

/****** UPDATE OUTPUTS FUNCTION *****/
void updateOutputs()
{
	myServo.write(servo_Servomotor_PWMSignal_PIN_D2_rawData);
}

/****** START WEB SERVER FUNCTION *****/
void startWebServer()
{
	// Code to initialize and start the web server
	// This would typically include setting up routes and handlers
}

/****** HANDLE CLIENT FUNCTION *****/
void handleClient()
{
	// Code to handle incoming web client requests
	// This would typically include sending the lock/unlock state to the client
}

/* END CODE */

#!/usr/bin/python3

from PySabertooth import Sabertooth, Range
from flask import Flask, render_template
import serial
from time import sleep
import decimal

# on the beaglebone related boards, use a known, working UART port on the headers.

# For instance, attach P9_21 to S1 on the sabertooth 2 x 12 and attach GND on the sabertooth to GND on your BBB.
# "/dev/ttyS2" has changed in time. Check for changes...

saber = Sabertooth("/dev/bone/uart/2", baudrate=9600, timeout=0.1)
ser = serial.Serial("/dev/bone/uart/1", baudrate=9600, timeout=0.1)

# start and enable a service, start a cron job, or make an executable .sh file for use when booting into this file.

app = Flask(__name__)
@app.route("/")
@app.route("/<gar>")
@app.route("/<state>")
class dire:
    def siri(gar=None):
        try:
            if gar == '6' or gar >= '7':
                data = ser.read_until(b'\r')
                ranger = data[1:-1]
                ranger = bytes.decode(ranger)
                ranger = str(ranger)
                print("distance = ", ranger, "inches away..")
                sleep(3)
            sleep(0.1)

        except serial.SerialException as e:
            print(f"Error opening serial port: {e}")
            raise

    def sab(state=None):
        if state == "F":
            print ("Robot Moving Forward")
            try:
                saber.drive(1, 70)
                saber.drive(2, 70)
            except ranger <= '5':
                print("Accessing AI...")
                saber.drive(1, -5)
                saber.drive(2, -5)
                pass

        if state == "R":
            print ("Robot Turning Right")
            try:
                saber.drive(1, 75)
                saber.drive(2, 25)
            except ranger <= '5':
                print("Accessing AI...")
                saber.drive(1, -5)
                saber.drive(2, -5)
                pass

        if state == "L":
            print ("Robot Turning Left")
            try:
                saber.drive(1, 25)
                saber.drive(2, 75)
            except ranger <= '5':
                print("Accessing AI...")
                saber.drive(1, -5)
                saber.drive(2, -5)
                pass

        if state == "S":
            print ("Robot Stopped")
            try:
                saber.drive(1, 0)
                saber.drive(2, 0)
            except ranger <= '5':
                print("Accessing AI...")
                saber.drive(1, -5)
                saber.drive(2, -5)
                pass

        if state == "START":
            print("Starting from a stop...")
            saber.drive(1, True)
            saber.drive(2, True)

        if state == "REV":
            print("Reversing")
            try:
                saber.drive(1, -55)
                saber.drive(2, -55)
            except ranger <= '5':
                print("Accessing AI...")
                saber.drive(1, 5)
                saber.drive(2, 5)
                pass

        if state == "SPIN":
            print("Loops...")
            saber.drive(1, -55)
            saber.drive(2, 55)

        template_data = {
            "title" : state,
        }
        return render_template("Saber.html", name=(state, gar))

    if __name__=="__main__":
        app.run(host="0.0.0.0", port=5000, debug=True)



