using namespace std;

const int maxn = 1000;

struct stek {
    char niza[maxn];
    int idx;
    
    void init() {
        idx = -1;
    }
    
    void push(char x) {
        if(idx + 1 >= maxn) {
            cout << "NEMA DOVOLNO KAPACITET" << endl;
            return;
        }
        idx++;
        niza[idx] = x;
    }
    
    char pop() {
        if(idx == -1) {
            cout << "NEMA NITU EDEN ELEMENT VO STEKOT" << endl;
            return '\0';
        }
        char result = niza[idx];
        idx--;
        return result;
    }
    
    char top() {
        if(idx == -1) {
            cout << "NEMA NITU EDEN ELEMENT VO STEKOT" << endl;
            return '\0';
        }
        return niza[idx];
    }
    
    int size() {
        return idx + 1;
    }
    
    int isEmpty() {
        if(idx == -1) {
            return 1;
        }
        else {
            return 0;
        }
    }
};
