    string s;
    cin >> s;
    
    stek st;
    st.init();
    
    for(int i = 0; i  <s.size(); i++) {
        if(s[i] == '(' || s[i] == '{' || s[i] == '[') {
            st.push(s[i]);
        }
        else {
            if(s[i] == ')') {
                if(st.isEmpty() == 0 && st.top() == '(') {
                    st.pop();
                }
            }
            else if(s[i] == ']') {
                if(st.isEmpty() == 0 && st.top() == '[') {
                    st.pop();
                }
            }
            else if(s[i] == '}') {
                if(st.isEmpty() == 0 && st.top() == '{') {
                    st.pop();
                }
            }
        }
    }
    if(st.isEmpty() == 1) {
        cout << "DA" << endl;
    }
    else {
        cout << "NE" << endl;
    }
    return 0;
}

